import React, { useEffect, useState } from "react";

// CSS
import './Home.css';

// API
import { api } from "../../../utils/api";

const Home = () => {
    const [verify, setVerify] = useState<boolean>(false);
    const [page, setPage] = useState<number>(1);

    useEffect(() => {
        api.get(`vehicles?page=${page}`)
        .then((res: any) => {
            setPage(page+1)
        })
    }, [verify])

    return(
        <div>
            <h1>Home</h1>
        </div>
    );
}

export default Home;
